import { configureStore } from "@reduxjs/toolkit";
import productSlice from "./createSlice/productReducer";
import orderReducer from "./createSlice/orderReducer";
import paymentReducer from "./createSlice/paymentReducer";

const store = configureStore({
  reducer: {
    product: productSlice.reducer,
    payment: paymentReducer,
    order: orderReducer,
  },
});

export default store;
